function add (a, b) {
    return a + b;
}
const twoPlusFour = add(2, 4);
console.log(twoPlusFour);
function LegacyES() {
    return (
        <>
            <h2>Functions</h2>
            <h3>Legacy ES5 Functions</h3>
            twoPlusFour = { twoPlusFour } <br/>
            add(2, 4) = { add(2, 4)} <br/>
        </>
    )
} export default LegacyES;
